import React from "react";
import Typography from "@mui/material/Typography";
import Button from "@mui/material/Button";

export default function Create() {
  return (
    <div>
      <Typography
        variant="h6"
        component="h2"
        gutterBottom
        color="textSecondary"
      >
        Create a note
      </Typography>

      <Button type="submit" color="secondary" variant="contained">
        Submit
      </Button>
    </div>
  );
}
